-- Fixed SQL from sample.txt with UPSERT handling
-- Generated on: 2025-06-11T01:41:22.109Z
-- Total resources: 196
-- This version uses ON CONFLICT DO UPDATE to handle duplicates

-- Insert all resources from sample.txt with UPSERT
ON CONFLICT (domain) DO UPDATE SET
    url = EXCLUDED.url,
    domain_authority = EXCLUDED.domain_authority,
    category = EXCLUDED.category,
    cost = EXCLUDED.cost,
    notes = EXCLUDED.notes,
    updated_at = CURRENT_TIMESTAMP;

-- Summary of inserted/updated resources
SELECT 
    category,
    COUNT(*) as count,
    AVG(domain_authority) as avg_da,
    COUNT(*) FILTER (WHERE cost = 0) as free_submissions,
    COUNT(*) FILTER (WHERE cost > 0) as paid_submissions
FROM resources 
GROUP BY category
ORDER BY count DESC;

-- Show total count
SELECT COUNT(*) as total_resources FROM resources; 